import { login } from '../services/Api'

function Auth () {
  const handleSubmit = async (credentials) => {
    login(credentials)
  }

  return (
    <>
      <h1>AUTHENTIFICATION</h1>
      <LoginForm onSubmit={handleSubmit} />
    </>
  )
}

export default Auth
